    private val mrn1 = mockk<Identifier> {
        every { value } returns "123456".asFHIR()
        every { system } returns Uri("http://projectronin.com/id/mrn")
    }
    private val fhir1 = mockk<Identifier> {
        every { value } returns "654321".asFHIR()
        every { system } returns Uri("http://projectronin.com/id/fhir")
    }

    private val fhir2 = mockk<Identifier> {
        every { value } returns "12345678".asFHIR()
        every { system } returns Uri("http://open.epic.com/FHIR/StructureDefinition/patient-fhir-id")
    }

    private val practitionerId1 = mockk<Identifier> {
        every { value } returns "654321".asFHIR()
        every { use } returns Code("usual")
        every { type } returns CodeableConcept(text = "MDACC".asFHIR())
        every { system } returns Uri("http://projectronin.com/id/fhir")
    }
    private val practitionerId2 = mockk<Identifier> {
        every { value } returns "123456789".asFHIR()
        every { use } returns Code("unusual")
        every { type } returns CodeableConcept(text = "TEST".asFHIR())
        every { system } returns Uri("http://projectronin.com/id/fhir")
    }
    private val ssn = mockk<Identifier> {
        every { value } returns "987-65-4321".asFHIR()
        every { system } returns Uri("http://hl7.org/fhir/sid/us-ssn")
    }
    private val tenant = mockk<Identifier> {
        every { value } returns "randomid".asFHIR()
        every { system } returns Uri("system")
    }

    private val name1 = mockk<HumanName> {
        every { given } returns listOf("GIVENNAME").asFHIR()
        every { family } returns "FAMILYNAME".asFHIR()
        every { use } returns Code("official")
    }

    private val name2 = mockk<HumanName> {
        every { given } returns listOf("GIVENNAMEanother").asFHIR()
        every { family } returns "FAMILYNAMEanother".asFHIR()
        every { use } returns Code("usual")
    }

    private val address1 = mockk<Address> {
        every { line } returns listOf("123 ABC Street", "Unit 1").asFHIR()
        every { city } returns "Anytown".asFHIR()
        every { state } returns "CA".asFHIR()
        every { postalCode } returns "12345".asFHIR()
        every { country } returns "USA".asFHIR()
    }

    private val phone1 = mockk<ContactPoint> {
        every { value } returns "1234567890".asFHIR()
        every { use } returns ContactPointUse.HOME.asCode()
    }
    private val phone2 = mockk<ContactPoint> {
        every { value } returns "0987654321".asFHIR()
        every { use } returns ContactPointUse.WORK.asCode()
    }
    private val phone3 = mockk<ContactPoint> {
        every { value } returns "8607455312".asFHIR()
        every { use } returns ContactPointUse.MOBILE.asCode()
    }
    private val mdmPractitionerFields = mockk<MDMPractitionerFields> {
        every { name } returns listOf(name1, name2)
        every { identifier } returns listOf(practitionerId1, practitionerId2)
    }
    private val mdmPatientFields = mockk<MDMPatientFields> {
        every { identifier } returns listOf(mrn1, ssn, fhir1, fhir2, tenant)
        every { name } returns listOf(name1, name2)
        every { dob } returns Date("1985-07-01")
        every { gender } returns AdministrativeGender.MALE
        every { address } returns listOf(address1)
        every { phone } returns listOf(phone1, phone2, phone3)
    }

    private val badIdentifier = mockk<Identifier> {
        every { value } returns "654321".asFHIR()
        every { system } returns null
    }
    private val badPhone = mockk<ContactPoint> {
        every { value } returns "8607455312".asFHIR()
        every { use } returns Code("dunno")
    }
    private val mdmGapPatient = mockk<MDMPatientFields> {
        every { identifier } returns listOf(mrn1, ssn, fhir1, fhir2, tenant, badIdentifier)
        every { name } returns listOf(name1, name2)
        every { dob } returns Date("1985-07-01")
        every { gender } returns AdministrativeGender.MALE
        every { address } returns listOf(address1)
        every { phone } returns listOf(phone1, phone2, phone3, badPhone)
    }

