    @Test
    fun `generate hl7 mdm t08 - update a note`() {
        val note = "Caveat emptor"
        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011255", "999")

        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()

        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        assertEquals("2.5.1", terser.get("/MSH-12"))
        assertEquals("MDM", terser.get("/MSH-9-1"))
        assertEquals("T08", terser.get("/MSH-9-2"))
        assertEquals("MDM_T02", terser.get("/MSH-9-3"))
        assertEquals("T08", terser.get("/EVN-1"))
        assertEquals("202206011255", terser.get("/EVN-2"))
        assertEquals("123456", terser.get("/PID-3(0)"))
        assertEquals("FAMILYNAME", terser.get("/PID-5(0)-1-1"))
        assertEquals("GIVENNAME", terser.get("/PID-5(0)-2"))
        assertEquals("19850701", terser.get("/PID-7-1"))
        assertEquals("123 ABC Street, Unit 1", terser.get("/PID-11(0)-1-1"))
        assertEquals("Anytown", terser.get("/PID-11(0)-3"))
        assertEquals("CA", terser.get("/PID-11(0)-4"))
        assertEquals("12345", terser.get("/PID-11(0)-5"))
        assertEquals("USA", terser.get("/PID-11(0)-6"))
        assertEquals("1234567890", terser.get("/PID-13(0)-1"))
        assertEquals("PRN", terser.get("/PID-13(0)-2"))
        assertEquals("0987654321", terser.get("/PID-13(1)-1"))
        assertEquals("WPN", terser.get("/PID-13(1)-2"))
        assertEquals("8607455312", terser.get("/PID-13(2)-1"))
        assertEquals("ORN", terser.get("/PID-13(2)-2"))
        assertEquals("FAMILYNAME", terser.get("/TXA-5(0)-2-1"))
        assertEquals("GIVENNAME", terser.get("/TXA-5(0)-3"))
        assertEquals("999", terser.get("/TXA-12-3"))
        assertEquals(null, terser.get("/TXA-13"))
        assertEquals(
            "Caveat emptor",
            terser.get("/OBSERVATION(0)/OBX-5")
        )
    }

