        val mrn = mockk<Identifier> {
            every { value } returns null
            every { system } returns Uri("http://projectronin.com/id/mrn")
            every { use } returns null
        }
        val fhir = mockk<Identifier> {
            every { value } returns null
            every { system } returns Uri("http://projectronin.com/id/fhir")
            every { use } returns null
        }
        val name1 = mockk<HumanName> {
            every { given } returns listOf()
            every { family } returns null
            every { use } returns null
        }
        val address1 = mockk<Address> {
            every { line } returns listOf()
            every { city } returns null
            every { state } returns null
            every { postalCode } returns null
            every { country } returns null
        }
        val phone1 = mockk<ContactPoint> {
            every { value } returns null
            every { use } returns ContactPointUse.HOME.asCode()
        }
        val phone2 = mockk<ContactPoint> {
            every { value } returns null
            every { use } returns ContactPointUse.WORK.asCode()
        }
        val phone3 = mockk<ContactPoint> {
            every { value } returns null
            every { use } returns ContactPointUse.MOBILE.asCode()
        }
        val mdmPatientFields = mockk<MDMPatientFields> {
            every { identifier } returns listOf(mrn, fhir)
            every { name } returns listOf(name1)
            every { dob } returns null
            every { gender } returns AdministrativeGender.MALE
            every { address } returns listOf(address1)
            every { phone } returns listOf(phone1, phone2, phone3)
        }
        val mdmPractitionerFields = mockk<MDMPractitionerFields> {
            every { name } returns listOf(name1)
            every { identifier } returns listOf(fhir)
        }

        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250")

        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()

        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        assertNull(terser.get("/PID-3(0)"))
        assertNull(terser.get("/PID-3(1)"))
        assertNull(terser.get("/PID-5(0)-1-1"))
        assertNull(terser.get("/PID-5(0)-2"))
        assertNull(terser.get("/PID-7-1"))
        assertNull(terser.get("/PID-11(0)-1-1"))
        assertNull(terser.get("/PID-11(0)-3"))
        assertNull(terser.get("/PID-11(0)-4"))
        assertNull(terser.get("/PID-11(0)-5"))
        assertNull(terser.get("/PID-11(0)-6"))
        assertNull(terser.get("/PID-13(0)-1"))
        assertNull(terser.get("/PID-13(1)-1"))
        assertNull(terser.get("/PID-13(2)-1"))
        assertNull(terser.get("/TXA-5(0)-2-1"))
        assertNull(terser.get("/TXA-5(0)-3"))
    }

