    @Test
    fun `replace tabs with spaces`() {
        val note = "one potato\ttwo potato\t\tthree"
        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250")

        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()
        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        assertEquals("one potato    two potato        three", terser.get("/OBSERVATION(0)/OBX-5"))
    }

    @Test
    fun `replace tabs with spaces multiline`() {
        val note = "many\tpotatoes\neven\tmore\tpotatoes\r\tpotato paradise"
        val hl7 = MDMService().generateMDM("Test", mdmPatientFields, mdmPractitionerFields, note, "202206011250")

        val context: HapiContext = DefaultHapiContext()
        context.validationContext = ValidationContextFactory.defaultValidation()
        val parser: Parser = context.pipeParser
        val message = parser.parse(hl7.first)
        val terser = Terser(message)
        assertEquals("many    potatoes", terser.get("/OBSERVATION(0)/OBX-5"))
        assertEquals("even    more    potatoes", terser.get("/OBSERVATION(1)/OBX-5"))
        assertEquals("    potato paradise", terser.get("/OBSERVATION(2)/OBX-5"))
    }

